import React, {PureComponent} from 'react';
import {NavLink} from 'react-router-dom';
import headerStyle from './index.module.css';
import {Redirect, Route, Switch} from "react-router";
import IndexFrame from "../../pages/IndexFrame";
import {Button} from "antd";
import {UserOutlined} from '@ant-design/icons';

class Header extends PureComponent {
    render() {
        return (
            <>
                <div className={headerStyle.header}>
                    <div className={headerStyle.left}>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/index'>首页</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/production'>产品中心</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/community'>飞云社区</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/join'>加入飞云</NavLink>
                        <NavLink className={headerStyle.listItem} activeClassName={headerStyle.active}
                                 to='/wiki'>开发wiki</NavLink>
                    </div>
                    <div className={headerStyle.right}>
                        <Button type='link' icon={<UserOutlined/>}>企业注册</Button>
                    </div>
                </div>
                <div>
                    <Switch>
                        <Route path='/index' component={IndexFrame}/>
                        <Route path='/production' component={IndexFrame}/>
                        <Route path='/community' component={IndexFrame}/>
                        <Route path='/join' component={IndexFrame}/>
                        <Route path='/wiki' component={IndexFrame}/>
                        <Redirect to='/index'/>
                    </Switch>
                </div>
            </>

        );
    }
}

export default Header;
